import React from 'react';
import {Link} from 'react-router-dom';
import FontAwesome from 'react-fontawesome';
import style from './sideNav.module.css';

const SideNavItems = () => {
    return(
        <div className={style.option}>
            Link
        </div>
    )
}
export default SideNavItems;
